// DropDown.stories.js

import React from 'react';
import { storiesOf } from '@storybook/react';
import DropDown from './DropDown';

storiesOf('DropDown', module)
  .add('내 노래', () => <DropDown type="내 노래" onChange={(option) => console.log(option)} />)
  .add('내 이웃', () => <DropDown type="내 이웃" onChange={(option) => console.log(option)} />)
  .add('학습기록', () => <DropDown type="학습기록" onChange={(option) => console.log(option)} />)
  .add('내 게시글', () => <DropDown type="내 게시글" onChange={(option) => console.log(option)} />);
